        <div className="dashboard-container">
        <div className="admin_side_panel">
            <ul className="admin_links_list">
                    <Link to="/admin/dashboard">
                    <button className="admin_links">Kezdőlap</button>
                    </Link>
                    

                     <Link to="/admin/dashboard/kolcsonzesek">
                    <button className="admin_links">Kölcsönzések</button>
                     </Link>

                    <Link to="/admin/dashboard/ajandekbolt">
                    <button className="admin_links">Ajándékbolt</button>
                     </Link>

                    <button className="admin_links_active">Dolgozók</button>


                    <button className="admin_links">Kijelentkezés</button>
            </ul>
        </div>
        <div className="admin_content">

        <div className="overview_panel">

                    <h1>Dolgozók</h1>
                    <table className="employees">
                        <tr>
                            <th>Dolgozói Azonosító</th>
                            <th>Vezetéknév</th>
                            <th>Keresztnév</th>
                            <th>Email cím</th>
                        </tr>
                        <tr></tr>
                    </table>
                     <ReactPaginate
                                    previousLabel={"Előző"}
                                    nextLabel={"Következő"}
                                    pageCount={pageCount}
                                    onPageChange={changePage}
                                    containerClassName={"paginationBttns"}
                                    activeClassName={"paginationActive"}
                                />





                
            </div>



        </div>
            
        </div>
    )
}

export default AdminEmployees
